import React from "react";
import Header from "../Common/Header/Header";
import NavHeader from "../Common/Header/NavHeader/NavHeader";
import styled from "styled-components";
import Layouts from "../Common/Layout";

export default function NewProduct() {
  return (
    <>
      <Header />
      <Layouts>
        <NavHeader />

        <NewestBanner>
          <img
            src="https://collection-image.kurly.com/product-collections/2451/6pddBxhXhpA5o35T4Xd4FvpxnA6u11eTsZnwdXSb.png"
            alt="배너 이미지"
          />
        </NewestBanner>
      </Layouts>
    </>
  );
}

export const NewestBanner = styled.div`
  padding-bottom: 28px;
  text-align: center;
  & img {
    width: 100%;
    vertical-align: top;
    cursor: pointer;
    border: 0;
    max-width: 100%;
  }
`;
